import React, { useEffect } from "react";
// react routing
import { Route, Routes } from "react-router-dom";
// redux
import { useDispatch, useSelector } from "react-redux";

import { fetchCollectionsStartAsync } from "../../redux/shop/shop.actions";
// custom hooks
import useCollectionsData from "../../components/collections-overview/collections-overview.container";
import useCollectionData from "../collection/collection.container";

const ShopPage = () => {
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(fetchCollectionsStartAsync());
  }, [dispatch]);

  return (
    <div className="shop-page">
      <Routes>
        <Route path="/" element={useCollectionsData()} />
        <Route path=":collectionId" element={useCollectionData()} />
      </Routes>
    </div>
  );
};

export default ShopPage;
